  true,\n\t\"url\": null,\n\t\"notes\": \"The OASDI Public-Use Microdata File contains
  an extract of data fields from SSA's Master Beneficiary Record file and consists
  of a 1 percent random, representative sample of persons entitled to receive an OASDI
  benefit payment for December 2001. This file contains approximately 460,000 records,
  with 16 data fields on each record. Updated beneficiary information is also included
  in a sub-file of, Benefits Data for the Benefit and Earnings Public Use File, 2004
  (Dataset Unique ID 56).\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
